
-- Crear base de datos
CREATE DATABASE IF NOT EXISTS concesionario;
USE concesionario;

-- Crear tabla coches
CREATE TABLE IF NOT EXISTS coches (
    id INT(3) AUTO_INCREMENT PRIMARY KEY,
    marca VARCHAR(100),
    modelo VARCHAR(100),
	tipo VARCHAR(100),
    precio INT(4),
    imagen MEDIUMTEXT
);

